import Home from './Components/Home'
import Visit from './Components/Visit';
import { Routes ,Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
      <NavMenu />
      <Routes>
        <Route path ='/' exact></Route>
      </Routes>
      </Router>
    </>
  );
}

export default App;
